        // ÐÑÐ¾Ð²ÐµÑÑÐµÐ¼, ÑÐ²Ð»ÑÐµÑÑÑ Ð»Ð¸ Ð±ÑÐ°ÑÐ·ÐµÑ Ð¿Ð¾ÑÐµÑÐ¸ÑÐµÐ»Ñ ÑÐ°Ð¹ÑÐ° Firefox Ð¸ Ð¿Ð¾Ð»ÑÑÐ°ÐµÐ¼ ÐµÐ³Ð¾ Ð²ÐµÑÑÐ¸Ñ
        let isitFirefox = window.navigator.userAgent.match(/Firefox\/([0-9]+)\./);
