function formValidate(forms) {
    $(forms).validate({
        errorElement: "div",
        rules: {
            user_name: "required",
            user_phone: {
                required: !0,
                minlength: 17
            },
            user_email: {
                required: true,
                email: true
            },
        },
        messages: {
            user_name: "ÐÐ²ÐµÐ´Ð¸ÑÐµ Ð¸Ð¼Ñ",
            user_phone: "ÐÐ²ÐµÐ´Ð¸ÑÐµ ÑÐµÐ»ÐµÑÐ¾Ð½",
            user_email: {
                required: "ÐÐ²ÐµÐ´Ð¸ÑÐµ email",
                email: "ÐÐ²ÐµÐ´Ð¸ÑÐµ Ð² ÑÐ¾ÑÐ¼Ð°ÑÐµ: name@domain.com"
            },
        },
        submitHandler: function(forms) {
            $.ajax({
                type: "POST",
                url: "send.php",
                data: $(forms).serialize(),
                success: function (response) {
                    $(forms)[0].reset();
                    $('.popup-download').fadeOut();
                    $('.popup-call').fadeOut();
                    $('.popup-thanks, .overlay').fadeIn();
                    $('body').addClass('no_scroll');

                    $('.popup-thanks__close, .overlay').click(function(){
                        $('.popup-thanks, .overlay').fadeOut();
                        $('body').removeClass('no_scroll');
                    });
                },
                error: function (response) {
                    console.error('Ð§ÑÐ¾-ÑÐ¾ Ð¿Ð¾ÑÐ»Ð¾ Ð½Ðµ ÑÐ°Ðº' + response);
                }
            });
        }
    });
}
